  const { jsPDF } = window.jspdf;
  const pdf = new jsPDF();

  pdf.setFillColor(30, 30, 60);
  pdf.rect(0, 0, 210, 35, "F");

  const signatureImg = "data:image/png;base64,";

  const logoImg = "data:image/png;base64,"; 
