  pdf.line(20, 150, 190, 150);

  pdf.setFontSize(9);
  pdf.setTextColor(120);
  pdf.text("Thank you for using AurumCapital.", 105, 158, { align: "center" });
  pdf.setTextColor(160);
  pdf.text("www.AurumCapital.com  |  support@AurumCapital.com", 105, 165, { align: "center" });

  pdf.save(`AurumCapital-receipt-${depositId}.pdf`);
