async function fetchLiveRates() {
  try {
    const url = `https://api.coingecko.com/api/v3/simple/price?ids=bitcoin,ethereum,tether,litecoin,binancecoin&vs_currencies=usd`;
    const res = await fetch(url);
    const data = await res.json();

    currentBtcRate = data.bitcoin.usd; // still used globally

    const rates = {
      BTC: data.bitcoin.usd,
      ETH: data.ethereum.usd,
      USDT: data.tether.usd,
      LTC: data.litecoin.usd,
      BNB: data.binancecoin.usd
    };

    // Update live rate bar if you have these element IDs:
    Object.entries(rates).forEach(([symbol, usd]) => {
      const el = document.getElementById(`${symbol.toLowerCase()}Price`);
      if (el) {
        el.textContent = `$${usd.toLocaleString()}`;
      }
    });

  } catch (err) {
    console.error("⚠️ Live rate fetch error:", err);
  }
}





