async function calculateLiveProfits(userId) {
  const walletRef = doc(db, "Wallet", userId);
  const walletSnap = await getDoc(walletRef);

  // Base wallet amount from Firestore
  let baseBalance = 0;
  if (walletSnap.exists()) {
    const rawUsd = walletSnap.data().usd;
    baseBalance = typeof rawUsd === "number" ? rawUsd : parseFloat(rawUsd) || 0;
  }

  // Load user's investments
  const invSnap = await getDocs(collection(db, "Investments", userId, "records"));

  let totalInvested = 0;
  let totalEarnings = 0;

  invSnap.forEach(docSnap => {
    const d = docSnap.data();
    const id = docSnap.id;

    if (d.status === "active") {
  const invested = parseFloat(d.amount) || 0;

  let earned = 0;
  if (liveEarningsState?.has(id)) {
    earned = liveEarningsState.get(id);
  } else if (typeof d.earnedSoFar === "number") {
    earned = d.earnedSoFar;
  } else if (typeof d.earnedSoFar === "string") {
    earned = parseFloat(d.earnedSoFar) || 0;
  }
  if (isNaN(earned)) earned = 0;

  totalInvested += invested;
  totalEarnings += earned;
}

  });

  const totalDisplayBalance = baseBalance + totalInvested + totalEarnings;

  // Update UI — animate
  const balanceEl = document.querySelector(".atm-balance");
  if (balanceEl) {
    const currentDisplayed = parseFloat(balanceEl.textContent.replace(/[^0-9.]/g, "")) || 0;
    const step = (totalDisplayBalance - currentDisplayed) / 10;
    let count = 0;

    const animate = () => {
      if (count < 10) {
        const next = currentDisplayed + step * (count + 1);
        balanceEl.textContent = `$${formatMoney(next.toFixed(2))}`;
        count++;
        requestAnimationFrame(animate);
        
      } else {
        balanceEl.textContent = `$${formatMoney(totalDisplayBalance.toFixed(2))}`;
      }
    };

    balanceEl.classList.add("shimmer"); // shimmer effect
    animate();
    setTimeout(() => balanceEl.classList.remove("shimmer"), 600);
  }
}


